import './App.css';

function App() {
  const blogObj = {
    title:'New blog 1',
    description:'Content descirpo'
  }
  const first_name='Kofi';
  const job = 'Architect';
  return (
    <div className="App">
    <h3 className="Text-color">Full name : {first_name}</h3>
    <h2>Title:{blogObj.title}</h2>
    <h2>{blogObj.description}</h2>
    <p>Age: 23</p>
    <p>Job:{job}</p>

    <input placeholder='Enter data'/>
    </div>
  );
}

export default App;
